 Prototypes with the label A3B2\_mC20\_12\_3i\_2i: \begin{itemize} \item \href{current_web_home_dir/A3B2_mC20_12_3i_2i-001}{Mo$_{2}$As$_{3}$} \item \href{current_web_home_dir/A3B2_mC20_12_3i_2i-002}{Gd$_{2}$Cl$_{3}$} (this structure) \end{itemize}
